CREATE DATABASE localdb;
\connect localdb;


CREATE USER databas WITH PASSWORD 'databas'; 
CREATE SCHEMA AUTHORIZATION databas;  
ALTER USER databas SET search_path = databas, public; 
GRANT CONNECT ON DATABASE localdb TO databas;  
GRANT SELECT, INSERT, UPDATE, DELETE ON ALL TABLES IN SCHEMA databas TO databas; 
ALTER SCHEMA databas OWNER TO databas;


--  here the db can be created and populated OR do that with liquibase at a later stage

CREATE TABLE databas.apikey2empid
(
    api_key character varying(200) COLLATE pg_catalog."default" NOT NULL,
    emp_id character varying(25) COLLATE pg_catalog."default" NOT NULL,
    PRIMARY KEY(api_key,emp_id)
)

    TABLESPACE pg_default;

ALTER TABLE databas.apikey2empid
    OWNER to databas;




CREATE TABLE databas.employee
(
    emp_id character varying(25) COLLATE pg_catalog."default" NOT NULL,
    first_name character varying(100) COLLATE pg_catalog."default" NOT NULL,
    sur_name character varying(100) COLLATE pg_catalog."default" NOT NULL,
    chief_emp_id character varying(25) COLLATE pg_catalog."default" DEFAULT NULL::character varying,
    CONSTRAINT employee_pkey PRIMARY KEY (emp_id)
)

    TABLESPACE pg_default;

ALTER TABLE databas.employee
    OWNER to databas;
-- Index: employee_pk

-- DROP INDEX databas.employee_pk;

CREATE UNIQUE INDEX employee_pk
    ON databas.employee USING btree
        (emp_id COLLATE pg_catalog."default" ASC NULLS LAST)
    TABLESPACE pg_default;

CREATE TABLE databas.customer
(
    customer_id integer NOT NULL,
    customer_name character varying(100) COLLATE pg_catalog."default" NOT NULL,
    CONSTRAINT customer_pkey PRIMARY KEY (customer_id)
)

    TABLESPACE pg_default;

ALTER TABLE databas.customer
    OWNER to databas;
-- Index: customer_pk

-- DROP INDEX databas.customer_pk;

CREATE UNIQUE INDEX customer_pk
    ON databas.customer USING btree
        (customer_id ASC NULLS LAST)
    TABLESPACE pg_default;


CREATE TABLE databas.project
(
    customer_id integer NOT NULL,
    project_id integer NOT NULL,
    project_name character varying(100) COLLATE pg_catalog."default" NOT NULL,
    CONSTRAINT project_pkey PRIMARY KEY (customer_id, project_id),
    CONSTRAINT project_fk_to_cutomer FOREIGN KEY (customer_id)
        REFERENCES databas.customer (customer_id) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION
)

    TABLESPACE pg_default;

ALTER TABLE databas.project
    OWNER to databas;
-- Index: project_pk

-- DROP INDEX databas.project_pk;

CREATE UNIQUE INDEX project_pk
    ON databas.project USING btree
        (customer_id ASC NULLS LAST, project_id ASC NULLS LAST)
    TABLESPACE pg_default;

CREATE TABLE databas.activity
(
    customer_id integer NOT NULL,
    project_id integer NOT NULL,
    activity_id integer NOT NULL,
    activity_name character varying(100) COLLATE pg_catalog."default" NOT NULL,
    CONSTRAINT activity_pkey PRIMARY KEY (customer_id, project_id, activity_id),
    CONSTRAINT activity_fk_to_project FOREIGN KEY (customer_id, project_id)
    REFERENCES databas.project (customer_id, project_id) MATCH SIMPLE
    ON UPDATE NO ACTION
    ON DELETE NO ACTION
)

TABLESPACE pg_default;

ALTER TABLE databas.activity
    OWNER to databas;
-- Index: activity_pk

-- DROP INDEX databas.activity_pk;

CREATE UNIQUE INDEX activity_pk
    ON databas.activity USING btree
        (customer_id ASC NULLS LAST, project_id ASC NULLS LAST, activity_id  ASC NULLS LAST)
    TABLESPACE pg_default;

CREATE TABLE databas.reportedtime
(
    customer_id integer NOT NULL,
    project_id integer NOT NULL,
    activity_id integer NOT NULL,
    emp_id character varying(25) COLLATE pg_catalog."default" NOT NULL,
    reported_date timestamp with time zone NOT NULL,
    reported_time double precision NOT NULL,
    time_row_id integer NOT NULL,
    is_submitted  boolean  NOT NULL,
    description character varying(200) COLLATE pg_catalog."default",
    CONSTRAINT reportedtime_pkey PRIMARY KEY (customer_id, project_id, activity_id, emp_id, reported_date),
    CONSTRAINT reportedtime_fk_to_activity FOREIGN KEY (customer_id, project_id, activity_id)
        REFERENCES databas.activity (customer_id, project_id, activity_id) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION,
    CONSTRAINT reportedtime_fk_to_employee FOREIGN KEY (emp_id)
        REFERENCES databas.employee (emp_id) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION
)

    TABLESPACE pg_default;

ALTER TABLE databas.reportedtime
    OWNER to databas;
-- Index: reportedtime_pk

-- DROP INDEX databas.reportedtime_pk;

CREATE UNIQUE INDEX reportedtime_pk
    ON databas.reportedtime USING btree
        (customer_id ASC NULLS LAST, project_id ASC NULLS LAST, activity_id ASC NULLS LAST, emp_id COLLATE pg_catalog."default" ASC NULLS LAST, reported_date ASC NULLS LAST)
    TABLESPACE pg_default;




















